import React from 'react';
import { Route, BrowserRouter, Switch } from 'react-router-dom';

const Section = ({routes}) => {
    return (
      <BrowserRouter>
        <Switch>
           {  routes.map((route) =><Route path={route.path} render={route.component} />) }
        </Switch>
      </BrowserRouter>
    )
}

export default Section;
